## Examples The following code example inserts a new worksheet into a spreadsheet document by providing its file name. After you run the code example, examine the test file “WorksheetEx.xlsx” and notice the new worksheet named “mySheet.”
```csharp using System; using System.Linq; using DocumentFormat.OpenXml.Packaging; using DocumentFormat.OpenXml.Spreadsheet;
namespace WorkSheetEx { class Program { static void Main(string[] args) { string fileName = @"C:\Users\Public\Documents\WorksheetEx.xlsx";
using (SpreadsheetDocument spreadSheet = SpreadsheetDocument.Open(fileName, true)) { // Add a WorksheetPart. WorksheetPart newWorksheetPart = spreadSheet.WorkbookPart.AddNewPart<WorksheetPart>(); newWorksheetPart.Worksheet = new Worksheet(new SheetData());
// Create Sheets object. Sheets sheets = spreadSheet.WorkbookPart.Workbook.GetFirstChild<Sheets>(); string relationshipId = spreadSheet.WorkbookPart.GetIdOfPart(newWorksheetPart);
// Create a unique ID for the new worksheet. uint sheetId = 1; if (sheets.Elements<Sheet>().Count() > 0) { sheetId = sheets.Elements<Sheet>().Select(s => s.SheetId.Value).Max() + 1; }
// Give the new worksheet a name. string sheetName = "mySheet" + sheetId;
// Append the new worksheet and associate it with the workbook. Sheet sheet = new Sheet() { Id = relationshipId, SheetId = sheetId, Name = sheetName }; sheets.Append(sheet); } Console.WriteLine("All done."); Console.ReadKey(); } } }
```
```vb Imports System.Linq Imports DocumentFormat.OpenXml.Packaging Imports DocumentFormat.OpenXml.Spreadsheet Module Module1 Sub Main() Dim fileName As String = "C:\Users\Public\Documents\WorksheetEx.xlsx" Dim spreadSheet As SpreadsheetDocument = SpreadsheetDocument.Open(fileName, True)
Using (spreadSheet) ' Add a WorksheetPart. Dim newWorksheetPart As WorksheetPart = spreadSheet.WorkbookPart.AddNewPart(Of WorksheetPart)() newWorksheetPart.Worksheet = New Worksheet(New SheetData())
' Create a Sheets object. Dim sheets As Sheets = spreadSheet.WorkbookPart.Workbook.GetFirstChild(Of Sheets)() Dim relationshipId As String = spreadSheet.WorkbookPart.GetIdOfPart(newWorksheetPart)
' Get a unique ID for the new worksheet. Dim sheetId As UInteger = 1 If (sheets.Elements(Of Sheet).Count > 0) Then sheetId = sheets.Elements(Of Sheet).Select(Function(s) s.SheetId.Value).Max + 1 End If
' Give the new worksheet a name. Dim sheetName As String = ("mySheet" + sheetId.ToString())
' Append the new worksheet and associate it with the workbook. Dim sheet As Sheet = New Sheet sheet.Id = relationshipId sheet.SheetId = sheetId sheet.Name = sheetName sheets.Append(sheet) End Using Console.WriteLine("All done.") Console.ReadKey() End Sub End Module
```
